import Home from '../components/pages/home/Home.vue';

const PAGE_CODE = 'home';

const build = (widgets) => {
    return {
        title     : 'Home',
        name      : PAGE_CODE,
        path      : '/',
        widgets   : widgets || [],
        component : Home,
        inMenu    : true,
        icon      : 'home',
        exact     : true,
        permission: true
    }
}

export default {
    build,
    PAGE_CODE
}
